import React from 'react';
import List from './List'

class Results extends React.PureComponent {

    constructor(props) {
        super(props)
    }   

    render() {
        const { data } = this.props;
        return (
            <div>
                {data !== null} ?  <List results={data}/> : "no results"
            </div>
        )
    }
}

export default Results;
